import React from 'react';

const Profile = () => {
  return (
    <div>
      <h1>Profile Page</h1>
      <p>Name: John Doe</p>
      <p>Email: john@example.com</p>
      <button>Edit Profile</button>
    </div>
  );
};

export default Profile;
